INSERT INTO `comments` VALUES (1,'Évaluer en postant des commentaires...','ejIfB',272,1,'2020-11-03 11:51:14','2020-11-03 11:51:14'),(2,'Hello','EBgkj',272,3,'2020-11-03 13:33:10','2020-11-03 13:33:10'),(3,'super','XBIDF',272,2,'2020-11-03 14:22:40','2020-11-03 14:22:40'),(4,'8/10 correction de la lenteur/ouverture','j0MOA',272,14,'2020-11-03 16:04:34','2020-11-03 16:04:34'),(5,'09/10. assez simpliste et accessible à tout type d\'entreprise.','ZBcxz',272,24,'2020-11-04 08:07:45','2020-11-04 08:07:45'),(6,'faudrait me donner svp tous élements pour cette tâche','BTWYF',281,3,'2020-11-04 08:14:24','2020-11-04 08:14:24'),(7,'le template dépend du projet myaccount, le grant type du sso n\'est pas respecté','BfctT',281,3,'2020-11-04 08:18:39','2020-11-04 08:18:39'),(8,'Mon commentaire','oBkDq',276,18,'2020-11-04 08:19:16','2020-11-04 08:19:16'),(9,'7.5/10. Simple à utiliser mais les notifications continuent d\'arriver même après avoir terminé une tache.','zsdBP',272,23,'2020-11-05 15:43:14','2020-11-05 15:43:14'),(10,'super !!','AZQvAUTD',272,3,'2020-11-05 16:10:10','2020-11-05 16:10:10'),(11,'8/10, très cool.','IcMVWUUw',272,4,'2020-11-06 07:19:41','2020-11-06 07:19:41'),(12,'C\'est fait','YAcPEAza',283,1,'2020-11-10 09:35:08','2020-11-10 09:35:08'),(13,'Peut-on informer l\'auteur de la tâche, si un utilisateur marque une tâche terminée comme non terminée??','IEfmQYAV',283,1,'2020-11-10 09:39:12','2020-11-10 09:39:12'),(14,'Le test s\'est bien passé??','cUUNXmQZ',202,1,'2020-11-10 10:54:23','2020-11-10 10:54:23'),(15,'Pourrais-je avoir un retour sur ma question posée plus bas stp??','gB0NzdvP',283,1,'2020-11-10 11:11:33','2020-11-10 11:11:33'),(16,'bien reçu','ZUUcng2G',300,10,'2020-11-12 14:51:02','2020-11-12 14:51:02'),(17,'j ai terminé .le DG n est pas intéressé','ADAKMMRR',220,20,'2020-11-18 08:35:20','2020-11-18 08:35:20'),(18,'8/10\nExcellent!!!','ZXAQHjOV',272,5,'2020-11-18 14:03:12','2020-11-18 14:03:12'),(19,'8/10 trop cool','QVPwWUrQ',272,10,'2020-11-18 14:06:28','2020-11-18 14:06:28'),(20,'7/10','YZQDDMBM',272,25,'2020-11-18 15:49:57','2020-11-18 15:49:57'),(21,'Utilisateurs constant c\'est quoi ?','GLSQEmYV',326,3,'2020-11-23 08:35:31','2020-11-23 08:35:31'),(22,'quel lien ? celui que j\'ai reçu par mail ?','FFBqOjcA',337,3,'2020-11-26 10:18:18','2020-11-26 10:18:18'),(23,'quel format de sorti pour le QR code (une image .png, .jpg, .pdf)','qAMDCg9V',337,3,'2020-11-26 10:19:59','2020-11-26 10:19:59'),(24,'pourquoi demain ? c\'est pas  mieux lundi ?','WYdUwBUY',337,3,'2020-11-26 10:20:20','2020-11-26 10:20:20'),(25,'OK. C\'est bien noté','AAYUjnDI',291,36,'2020-12-14 11:57:52','2020-12-14 11:57:52'),(26,'Hello','TwyDYBMD',391,1,'2021-01-14 11:05:37','2021-01-14 11:05:37'),(27,'J\'ai envoyé un mail hier à monsieur Roger Ekoum le IT manager au regard des préoccupations et éventuelles suggestions de nos IT. J\'ai également appelé le monsieur ce matin pour vérifier de la bonne réception et de la prise en compte de mon mail envoyé hier. Il m\'a demandé de lui redonner l\'intitulé du email chose que j\'ai fait et m\'a promis de me revenir après lecture. D\'ici lundi nous allons caller une séance de travail en présentiel si les process par mailing tardent.','cQPwV3Um',444,47,'2021-03-12 09:41:51','2021-03-12 09:41:51'),(28,'yes','O9JXDQuC',459,18,'2021-03-17 10:49:36','2021-03-17 10:49:36'),(29,'Nous avons eu une séance de travail . Avec leur IT manager ... En moyenne ils utilisent 200 000 à 500 000 SMS par mois. Il est maintenant que nos IT trouvent le moyen de se connecter à leur système de gestion OS 400 écrit en langue COBOL.','A5A2DPdT',444,47,'2021-03-22 07:02:29','2021-03-22 07:02:29'),(30,'Nous aurons une séance de travail à propos de ce Plan','NTNHWV6Q',512,11,'2021-04-07 12:47:07','2021-04-07 12:47:07'),(31,'7/10','JSATsNVG',272,25,'2021-04-08 11:17:46','2021-04-08 11:17:46'),(32,'Projet mis en Stand by Jusqu\'en Mai par OCM','UdNWMAGU',124,11,'2021-04-12 08:36:40','2021-04-12 08:36:40'),(33,'Incident sur les plateforme Digipay depuis 3 jours Orange dit avoir géré la situation mais nous avons toujours des problèmes. trouble shooting en cours avec les IT et Pheuture','ewNSCT9m',513,11,'2021-04-12 08:39:41','2021-04-12 08:39:41'),(34,'Intégration de GF','PcmcBgVp',507,11,'2021-04-12 09:07:04','2021-04-12 09:07:04'),(35,'Contrat BULK SMS en stand By en Attente de la résolution du problème de VPN finalisation de l\'interco','XJBWAQND',386,11,'2021-04-15 13:45:00','2021-04-15 13:45:00'),(36,'Bonsoir Joseph, tu vas bien j\'espère, ci dessous mes tâches effectuées la semaine dernière:\n-Meeting avec OCM / Recouvrement: pour les deux mois qui étaient impayés Mars et Avril , de plus négocier pour le paiement du mois de Juin 2021 qui n\'était pas encore à son échéance.\n-Meeting avec Nexttel/ recouvrement: la négociation réussite à les convaincre de nous passer en paiement effectif et non en titre de compensation uniquement de nos services respectifs.\n-Rapports des différents OCM, WHYFI\n-Rapprochement payement OCM et nos états\n-Paie testeurs OCI et Burkina Faso\n-Dépots chèque UBA\n-Relance Nexttel pour Yield consolidation\n-Retrait lettre d\'information OCM\n-Dépôt ordres de virements','CABc9TPf',690,14,'2021-08-17 17:19:24','2021-08-17 17:19:24'),(37,'Je pense que ça sera compliqué','gAmVBJZH',424,1,'2022-03-22 09:22:01','2022-03-22 09:22:01'),(38,'Nexah','RQBTPg3N',822,51,'2022-04-05 16:24:06','2022-04-05 16:24:06'),(39,'ok','lVgbMTWB',822,55,'2022-04-05 16:24:17','2022-04-05 16:24:17'),(40,'ok','8ZAgTB6Q',822,55,'2022-04-05 16:24:30','2022-04-05 16:24:30'),(41,'ok','NRoABQTS',822,55,'2022-04-05 16:24:54','2022-04-05 16:24:54');
