ions pour les DLRs,\r\n3.	Transférer automatiquement toutes les données de plus de 4 jours dans les tables historique SMS et historique DLRs, \r\na.	Pour le faire, une des approches était de rajouter la date dans la composition du champ « smpp_sms_id »,\r\n4.	Dans l’API, ne faire les requêtes que sur les enregistrements de moins de 4 jours (En d’autres termes, ne faire que les requêtes sur les tables qui ne sont pas les historiques)','0000-00-00 00:00:00','2021-04-16 00:00:00','0000-00-00 00:00:00','2021-04-15 00:00:00',30,3,4,21,1,'2021-04-11 10:56:04','2021-04-15 15:13:03'),(555,'Dans le souci de résoudre les problématiques d’échec d’envoi de SMS vers MTN pour les sender IDs non encore whitelistés, écrire un programme qui :\r\n\r\nVérifie automatiquement si le sender ID est whitelisté chez MTN avant envoi :\r\n1.	Si le sender ID est whitelisté chez MTN, il dirige tous les messages MTN sur le réseau MTN, et les messages Orange sur le réseau Orange,\r\n2.	Si le sender ID n’est pas encore whitelisté, il redirige automatiquement toute la campagne sur le réseau OCM','0000-00-00 00:00:00','2021-04-16 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',30,4,3,21,1,'2021-04-11 11:13:38','2021-04-11 11:13:38'),(556,'Plateforme BULK SMS :\r\nIl existe des comptes « TEST » qui apparaissent en doublons.\r\n\r\n1. Bien vouloir corriger cela\r\n2. Bien vouloir mettre en place un système qui n’accepte pas de doublons pour les comptes clients.','0000-00-00 00:00:00','2021-04-21 00:00:00','0000-00-00 00:00:00','2021-04-14 00:00:00',30,3,3,21,1,'2021-04-11 13:30:40','2021-04-14 15:00:13'),(557,'Démarrer avec les tâches de qualification des prospects des commerciaux','0000-00-00 00:00:00','2021-04-12 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',74,4,4,21,1,'2021-04-11 14:07:21','2021-04-11 14:07:21'),(558,'Lors de notre récente réunion avec les commerciaux, il en est sorti que les clients trouvent nos communications SMS et Mails assez intrusives.\r\n \r\nBien vouloir nous